// codeFrequencyThunks.js
import {
  fetchCodeFrequencyStart,
  fetchCodeFrequencySuccess,
  fetchCodeFrequencyFailure,
} from "../redux/codefrequencySlice";
import { fetchChartData } from "./DropDownChart";
export const fetchCodeFrequencyData = (owner, repo) => async (dispatch) => {
  try {
    dispatch(fetchCodeFrequencyStart());

    const data = await fetchChartData(owner, repo);

    dispatch(fetchCodeFrequencySuccess(data));
  } catch (error) {
    dispatch(fetchCodeFrequencyFailure(error.message));
  }
};
